import {useState} from 'react'

const Keyboard = ({ alphabet, handleTry, usedLetters }) => {
    return (
        <div>
            <div>{ alphabet.slice(0, 13).map((letter) => <button key={letter} onClick={() => handleTry(letter)} disabled={usedLetters.includes(letter)}>{letter}</button>) }</div>
            <div>{ alphabet.slice(13, 26).map((letter) => <button key={letter} onClick={() => handleTry(letter)} disabled={usedLetters.includes(letter)}>{letter}</button>) }</div>
        </div>
    );
}

export default Keyboard
